import './App.css';
import Home from './pages/Home';

import { BrowserRouter ,Route ,Routes, Link} from 'react-router-dom'

function App() {

  return (


    <div className="App">
{/* Creo le rotte */}

      <Link to="/createpost"> Crea un post</Link>
      <BrowserRouter>
      <div>
        <Routes>
          <Route path="/" element={<Home/>} />
        </Routes>
        </div>
      </BrowserRouter>


    </div>
  );
}

export default App;
